import React, {Component} from "react";
import Cv from './Cv';
class Research extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            cvs: []
        };
    }

    render() {
        return (
            <div className="research-cv">
                <h2>Recherche</h2>
            </div>
        );
    }
}

export default Research;
